package main

import (
  "fmt"
  "strconv"
  "unicode"
)

func main() {
  var s string
  var numeri []int

  var b bool

  fmt.Scan(&s)
  for _, v := range s {
    if unicode.IsDigit(v) {
      n, _ := strconv.Atoi(string(v))
      numeri = append(numeri, n)
    }
  }
  for i := 0; i < len(numeri); i++ {
    if i == len(numeri)-1 {
      break
    }
    if numeri[i] >= numeri[i+1] {
      b = true
    } else {
      b = false
      break
    }
  }
  if b == false {
    fmt.Println("Sequenza nascosta non ordinata.")
  } else {
    fmt.Println("Sequenza nascosta ordinata.")
  }
}

